import logo from './logo.svg';
import './App.css';
import React from 'react';
FullName.defaultProps = {FirstName : 'f', LastName : 'l'};

function App() {
  return (
    <div className="App">
      <FullName FirstName = 'Daniel' LastName = 'Mykytiuk'/>
      <PhoneNumber PhoneNumber = '+380323999999'/>
      <MailAdress MailAdress = 'dan@gmail.com'/>
      <Counter/>
    </div>
  );
}


function MailAdress(props){
  return(
    <div>
      <h1>My Mail Adress</h1>
      <p>{props.MailAdress}</p>
    </div>
  )
}

function FullName(props) {
  let {FirstName:f, LastName:l}=props;
  return(
    <div>
      <h1>My Full Name</h1>
      <p>My name is <strong>{f} {l}</strong></p>
    </div>

  );
}
function MyGitHub(props){
  let {Github} = props;
  return(
    <div>
      <h1>My Git Hub</h1>
      <p>My name is <strong></strong></p>
    </div>
  );
}

class PhoneNumber extends React.Component{
  render(){
    let {PhoneNumber: pn} = this.props;
    return(
      <div>
        <h1>Phone Number</h1>
        <p>My phone number is <strong>{pn}</strong></p>
      </div>
    );
  }
}
PhoneNumber.defaultProps = {PhoneNumber : '+380999999999'};

class Counter extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      count: 0,
    };
  }
  render() {
    return (
      <div className="App">
        <h2>{this.state.count}</h2>
        <button onClick={() => this.setState({ count: this.state.count - 1 })}>
          -
        </button>
        <button onClick={() => this.setState({ count: this.state.count + 1 })}>
          +
        </button>

      </div>
    );
  }
}


export default App;
